import { Link } from '@react-navigation/native';
import React from 'react';
import { View, Text } from 'react-native';

const HomeScreen = () => {
  return (
    <View>
      <Text style={color="blue"}>This is my home screen!</Text>
     
    </View>
  );
};

export default HomeScreen;
